import React from 'react';
import ReactDOM from 'react-dom';
import './index.css'; // Assuming you have an index.css for global styles
import App from './App'; // The main App component

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
